<style>

        display: flex;
        justify-content: center;
        align-items: center;

        top: 0;
        left: 0;

        background-position: calc(50% - 75px) 50%;
        z-index: -1;
    }

    body {
        margin: 0;
        background: var(--background);
    }

    table {
        border-collapse: collapse;
    }
    td {
        padding: 10px;
        width: 130px;
        height: 130px;
    }
    .cell {
        width: 130px;
        height: 130px;
        display: block;
        font-size: 24pt;
        font-family: "Ubuntu Mono", monospace;
    }
    .cell * {
        color: white;
        padding: 0;
        margin: 0;
        position: fixed;
    }

    .cell * * {
        position: relative;
    }

    .bottom {
        position: relative;
        bottom: -102px;
    }

    #profile {
        margin-top: 65px;
        margin-left: 65px;
        border-radius: 75px;
        box-shadow: 0 10px 75px rgba(0, 0, 0, 0.5);
        width: 450px;
        height: 450px;
        z-index: 1;
    }

    .icon {
        max-height: 130px;
        max-width: 130px;
    }
</style>
